import React from 'react';
import "../../styles/Register.css";

const DoctorRegister = () => {
  const [username, setUsername] = useState('');
  const [firstName, setFirstName] = useState('');
  const [middleName, setMiddleName] = useState('');
  const [lastName, setLastName] = useState('');
  const [age, setAge] = useState('');
  const [sex, setSex] = useState('');
  const [birthday, setBirthday] = useState('');
  const [address, setAddress] = useState('');
  const [contactNumber, setContactNumber] = useState('');
  const [email, setEmail] = useState('');
  const [seniorId, setSeniorId] = useState('');
  const [pwdId, setPwdId] = useState('');
  const [philhealthId, setPhilhealthId] = useState('');
  const [hmo, setHmo] = useState('');
  const [password, setPassword] = useState('');
  const [retypePassword, setRetypePassword] = useState('');
  const [signupMessage, setSignupMessage] = useState('');
  const [otp, setOtp] = useState('');
  const [message, setMessage] = useState('');
  const [userType] = useState('patient');
  const [registrationSuccessful, setRegistrationSuccessful] = useState(false);






  return (
    <div className="reg-container" id="reg-container">
      <div className="register">
        <h1 style={{ color: '#0094d4' }}>Doctor Register</h1>
        <form action="#" id="register-form">
          <div className="reg-row">
            <div className="reg-infield">
              <input type="text" id="username" placeholder="*Username" name="username"/>
            </div>
            <div className="reg-infield">
              <input type="text" id="lastname" placeholder="*Last Name" name="lastname"/>
            </div>
          </div>
          <div className="reg-row">
            <div className="reg-infield">
              <input type="text" id="middlename" placeholder="Middle Name" name="middlename"/>
            </div>
            <div className="reg-infield">
              <input type="text" id="firstname" placeholder="*First Name" name="firstname"/>
            </div>
          </div>
          <div className="reg-row">
            <div className="reg-infield">
              <input type="number" id="age" placeholder="*Age" name="age" min="1" max="100"/>
            </div>
            <div className="reg-infield">
              <input type="text" id="sex" placeholder="*Sex" name="sex"/>
            </div>
          </div>
          <div className="reg-row">
            <div className="reg-infield" style={{ width: "50px", marginRight: "-10"}}> 
              <p style={{margin: "0", padding: "10px 0", color: "grey", fontSize: "12px"}}>*Birthdate</p>
            </div>
            <div className="reg-infield" style={{ width: "150px"}}>
              <input type="date" id="birthday" name="birthday" />
            </div>
            <div className="reg-infield" style={{ width: "500px"}}>
              <input type="text" id="address" placeholder="*(House/Lot/Unit No., Street, Barangay, City/Town, Province)" name="email"/>
            </div>
          </div>
          <div className="reg-row">
            <div className="reg-infield">
              <input type="text" placeholder="*Contact Number" name="contact"/>
            </div>
            <div className="reg-infield">
              <input type="email" placeholder="Email" name="email"/>
            </div>
          </div>
          <div className="reg-row">
            <div className="reg-infield">
              <input type="text" placeholder="*PRC ID Number" name="prc"/>
            </div>
            <div className="reg-infield">
              <input type="text" placeholder="Specialization" name="specialization"/>
            </div>
          </div>
          <div className="reg-row">
            <div className="reg-infield">
              <input type="password" placeholder="Password" />
            </div>
            <div className="reg-infield">
              <input type="password" placeholder="Re-enter Password" />
            </div>
          </div>
          <div className="reg-infield" style={{ display: 'flex', flexDirection: 'row', justifyContent: 'space-between', width: '690px' }}>
              <input type="text" placeholder="Credentials" name="credentials"/>
        </div>
        </form>
        <button type="submit">Add Clinic</button>
      </div>
    </div>
  );
};

export default DoctorRegister;
